import PropertyDetailedItem from "../component/properties/PropertyDetailedItem";
import PropertyItem from "../component/properties/PropertyItem";
import { useState, useEffect } from "react";
import { useParams } from 'react-router-dom';

function DetailPropertyPage() {
  const [isLoading, setIsLoading] = useState(true);
  const [loadedProp, setLoadedProp] = useState([]);
  const { barcode } = useParams();
  console.log(barcode)
  useEffect(() => {
    setIsLoading(true);
  fetch("http://localhost:3000/products/" + barcode)
    .then((response) => {
      setLoadedProp(response.data)
      
      return response.data;
    })
    .then((data) => {
      console.log(loadedProp.properties)
      setIsLoading(false)
    })
  }, []);
  if(isLoading){
    return (
      <section>
        <p>
          loading...
        </p>
      </section>
    );
  }
  console.log(loadedProp)
  return (
    <section>
      <h1>detail</h1>
      <PropertyItem properties={loadedProp} />
    </section>
  );
}

export default DetailPropertyPage;
